import { Component } from '@angular/core';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatSelectModule } from '@angular/material/select';
import { MatButtonModule } from '@angular/material/button';
import { FormControl, FormGroup, ReactiveFormsModule } from '@angular/forms';
import { Router } from '@angular/router';
import { MatDividerModule } from '@angular/material/divider';

@Component({
  selector: 'app-selector-dificultad-idioma',
  imports: [MatFormFieldModule, MatSelectModule, MatButtonModule, ReactiveFormsModule,  MatDividerModule],
  templateUrl: './selector-dificultad-idioma.html',
  styleUrl: './selector-dificultad-idioma.css',
})
export class SelectorDificultadIdioma {
  idiomas = ['spanish', 'english', 'french', 'portuguese'];
  idiomaLabels: Record<string, string> = {
  spanish: 'Español',
  english: 'Inglés',
  french: 'Francés',
  portuguese: 'Portugués'
  };
  dificultades = ['easy', 'medium', 'hard'];
  dificultadLabels: Record<string, string> = {
    easy: 'Fácil',
    medium: 'Medio',
    hard: 'Difícil'
  };
  idiomaSeleccionado: string = this.idiomas[0];
  dificultadSeleccionada: string = this.dificultades[0];
  formAhorcado: FormGroup;

  constructor(private router: Router) {
    this.formAhorcado = new FormGroup({
      idioma: new FormControl(this.idiomaSeleccionado),
      dificultad: new FormControl(this.dificultadSeleccionada),
    });
  }

  async iniciar_juego() {
    const idioma = this.formAhorcado.get('idioma')?.value;
    const dificultad = this.formAhorcado.get('dificultad')?.value;
    this.router.navigate(['/juego'], { queryParams: { idioma, dificultad } });
  }
}
<h1>Bienvenidos al juego del ahorcado!</h1>

<div class="contenedor-ahorcado">
  <form [formGroup]="formAhorcado" (ngSubmit)="iniciar_juego()">
    <div class="selector-ahorcado">
      <h2>Seleccionar Idioma</h2>
      <mat-form-field appearance="fill">
        <mat-label>Idioma</mat-label>
        <mat-select formControlName="idioma">
        @for (idioma of idiomas; track idioma) {
          <mat-option [value]="idioma">{{ idiomaLabels[idioma].toUpperCase() }}</mat-option>
        }
        </mat-select>
      </mat-form-field>
      <mat-divider></mat-divider>
      <h2>Seleccionar Dificultad</h2>
      <mat-form-field appearance="fill">
        <mat-label>Dificultad</mat-label>
        <mat-select formControlName="dificultad">
          @for (dificultad of dificultades; track dificultad) {
          <mat-option [value]="dificultad">{{ dificultadLabels[dificultad].toUpperCase() }}</mat-option>
          }
        </mat-select>
      </mat-form-field>

      <section>
        <div class="example-button-row">
          <button mat-raised-button color="primary" type="submit">Jugar</button>
        </div>
      </section>
    </div>
  </form>
</div>

// @ts-ignore: allow importing JSON without enabling "resolveJsonModule" in tsconfig
interface Palabra {
  id: number;
  solution: string;
}

export class Ahorcado {
  private palabraSecreta: string = '';
  private letrasIngresadas: string[] = [];
  private letrasAcertadas: string[] = [];
  private letrasErradas: string[] = [];
  private intentosRealizados: number = 0;
  private maxIntentos: number = 6;
  private idioma: string = "spanish";
  private dificultad: string = "easy";

  constructor(palabraSecreta?: string, idioma?: string, dificultad?: string) {
    try {
      if (palabraSecreta != undefined) {
        this.palabraSecreta = palabraSecreta.toLowerCase();
      } else {
        this.idioma = idioma || 'spanish';
        this.dificultad = dificultad || 'easy';
        this.establecer_juego(this.idioma, this.dificultad);
      }
    } catch (error) {
      throw new Error('Error al establecer la palabra secreta: ' + error);
    }
  }

  private async establecer_juego(idioma: string, dificultad: string): Promise<void> {
    this.palabraSecreta = await this.nueva_palabra_secreta(idioma, dificultad);
  }

  public adivinar_letra(letra: string): boolean {
    if (!this.verificar_letra_ingresada_repetida(letra)) {
      letra = letra.toLowerCase();
      this.letrasIngresadas.push(letra);
      if (this.palabraSecreta.includes(letra)) {
        this.letrasAcertadas.push(letra);
        return true;
      } else {
        this.letrasErradas.push(letra);
        this.intentosRealizados++;
        return false;
      }
    } else {
      return false;
    }
  }
  public verificar_letra_ingresada_repetida(letra: string): boolean {
    letra = letra.toLowerCase();
    return this.letrasIngresadas.includes(letra);
  }

  public get_cantidad_intentos_realizados(): number {
    return this.intentosRealizados;
  }

  public mostrar_progreso_palabra(): string {
    return this.palabraSecreta
      .split('')
      .map((l) => (this.letrasAcertadas.includes(l) ? l : '_'))
      .join('');
  } // Explico la funcion por si no se entiende: Toma la palabraSecreta,
  //  crea un array con sus letras (split), luego mapea con cada letra (map)
  // y verifica si estan incluidas, si estan devuelve la letra, caso contrario devuelve "-", y finalmente une todo en un string (join).
  public es_victoria_o_es_derrota(): 'victoria' | 'derrota' | 'en progreso' {
    if (this.mostrar_progreso_palabra() === this.palabraSecreta) {
      return 'victoria';
    } else if (this.intentosRealizados >= this.maxIntentos) {
      return 'derrota';
    }
    return 'en progreso';
  }

  public informar_letras_utilizadas(): string[] {
    return this.letrasIngresadas;
  }

  public informar_intentos_restantes(): number {
    return this.maxIntentos - this.intentosRealizados;
  }

  public informar_palabra_secreta(): string {
    return this.palabraSecreta;
  }

  public mostrar_letras_acertadas(): string[] {
    return this.letrasAcertadas;
  }

  public async reiniciar_juego(confirmacion: boolean): Promise<boolean> {
    if (confirmacion) {
      this.letrasIngresadas = [];
      this.letrasAcertadas = [];
      this.letrasErradas = [];
      this.intentosRealizados = 0;
      this.maxIntentos = 6;
      this.palabraSecreta = await this.nueva_palabra_secreta(this.idioma, this.dificultad);
      return true;
    }
    return false;
  }

  public letras_erradas(): string[] {
    return this.letrasErradas;
  }

  public no_permitir_ingresar_letras_si_el_juego_finalizo(): boolean {
    return this.es_victoria_o_es_derrota() !== 'en progreso';
  }

  private async nueva_palabra_secreta(
    idioma: string = 'spanish',
    dificultad: string = 'easy'
  ): Promise<string> {
    const { default: lista } = await import(`../languages/${idioma}-${dificultad}-words.json`);

    const palabras: Palabra[] = lista as Palabra[];

    const palabraAleatoria = palabras[Math.floor(Math.random() * palabras.length)];

    return palabraAleatoria.solution.normalize("NFD").replace(/[\u0300-\u036f]/g, "").toLowerCase();
  }
}

import { Component, Inject, OnInit } from '@angular/core';
import { MatButtonModule } from '@angular/material/button';
import {
  MAT_DIALOG_DATA,
  MatDialogRef,
  MatDialogTitle,
  MatDialogContent,
  MatDialogActions,
} from '@angular/material/dialog';
import { MatDividerModule } from '@angular/material/divider';

interface DialogData {
  resultado: string;
  palabraSecreta: string;
}

@Component({
  selector: 'app-dialog-reinicio',
  imports: [MatButtonModule, MatDialogTitle, MatDialogContent, MatDialogActions, MatDividerModule],
  templateUrl: './dialog-reinicio.html',
  styleUrl: './dialog-reinicio.css',
})
export class DialogReinicio implements OnInit {
  resultado: string = '';
  palabraSecreta: string = '';
  constructor(
    @Inject(MAT_DIALOG_DATA) public dialogData: DialogData,
    public dialogRef: MatDialogRef<DialogReinicio>
  ) {}

  ngOnInit(): void {
    this.resultado = this.dialogData.resultado;
    this.palabraSecreta = this.dialogData.palabraSecreta;
  }

  onClose(): void {
    this.dialogRef.close('none');
  }

  reiniciarJuego(): void {
    this.dialogRef.close('reiniciar');
  }
}
<h2 mat-dialog-title class="dialog-title">¡ Juego Finalizado !</h2>
<mat-divider></mat-divider>
<mat-dialog-content class="dialog-content">
  <div class="resultado-wrap">
    <span class="outcome-icon">
      {{ resultado!.toLowerCase().includes('vic') ? '🎉' : '😞' }}
    </span>
    <div class="resultado-text">
      <div class="estado">{{ resultado.toUpperCase() || 'RESULTADO DESCONOCIDO' }}</div>
      <div class="subtexto">La palabra era:</div>
      <div class="palabra-secreta">{{ palabraSecreta.toUpperCase() || '—' }}</div>
    </div>
  </div>
  <p class="pregunta">¿Desea jugar nuevamente?</p>
</mat-dialog-content>
<mat-divider></mat-divider>
<mat-dialog-actions align="end" class="dialog-actions">
  <button mat-button (click)="onClose()" class="btn-no" aria-label="No jugar">No</button>
  <button mat-button (click)="reiniciarJuego()" class="btn-si" aria-label="Jugar de nuevo">
    Sí
  </button>
</mat-dialog-actions>

import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { OnInit } from '@angular/core';
import { Ahorcado } from '../../../resources/models/ahorcado';
import { Router } from '@angular/router';
import { CommonModule } from '@angular/common';
import { MatFormFieldModule } from '@angular/material/form-field';
import { FormsModule, ReactiveFormsModule, FormControl, Validators } from '@angular/forms';
import { MatButtonModule } from '@angular/material/button';
import { MatInputModule } from '@angular/material/input';
import { DialogReinicio } from '../dialog-reinicio/dialog-reinicio';
import { MatDialog } from '@angular/material/dialog';
import { ComponentType } from '@angular/cdk/portal';
import { MatDividerModule } from '@angular/material/divider';

@Component({
  selector: 'app-juego-ahorcado',
  imports: [
    CommonModule,
    FormsModule,
    ReactiveFormsModule,
    MatFormFieldModule,
    MatInputModule,
    MatButtonModule,
    MatDividerModule,
  ],
  templateUrl: './juego-ahorcado.html',
  styleUrl: './juego-ahorcado.css',
})
export class JuegoAhorcado implements OnInit {
  juego!: Ahorcado;
  palabraMostrada = '';
  idioma!: string;
  dificultad!: string;
  intentosRestantes!: number;
  letrasUtilizadas: string[] = [];
  
  letraControl = new FormControl('', [
    Validators.required,
    Validators.pattern('^[a-zA-Z]$'),
    Validators.maxLength(1)
  ]);

  constructor(private route: ActivatedRoute, private router: Router, private dialog: MatDialog) {
    this.ngOnInit();
  }

  openDialog(dialog: ComponentType<unknown>, data: object): void {
    const dialogRef = this.dialog.open(dialog, {
      data: data,
    });

    dialogRef.afterClosed().subscribe((result) => {
      if (result !== 'none') {
        this.reiniciarJuego(true);
      } else {
        this.reiniciarJuego(false);
      }
    });
  }

  async ngOnInit() {
    this.idioma = this.route.snapshot.queryParamMap.get('idioma') || 'spanish';
    this.dificultad = this.route.snapshot.queryParamMap.get('dificultad') || 'easy';
    const palabraForzada = this.route.snapshot.queryParamMap.get('palabraForzada');
    if(palabraForzada !== null) {
      this.juego = new Ahorcado(palabraForzada, undefined, undefined);
    }else {
      this.juego = new Ahorcado(undefined, this.idioma, this.dificultad);
    }
    this.intentosRestantes = 6 - this.juego.get_cantidad_intentos_realizados();
    this.palabraMostrada = '_'.repeat(this.juego.informar_palabra_secreta().length);
    this.actualizarLetrasUtilizadas();

    this.letraControl.valueChanges.subscribe(value => {
      if (value && value.length > 0) {
        const letraFiltrada = value.replace(/[^a-zA-Z]/g, '');
        if (letraFiltrada !== value) {
          this.letraControl.setValue(letraFiltrada.charAt(0).toUpperCase(), { emitEvent: false });
        } else if (value.length === 1) {
          this.letraControl.setValue(value.toUpperCase(), { emitEvent: false });
        }
      }
    });
  }

  mostrarProgreso() {
    this.palabraMostrada = this.juego.mostrar_progreso_palabra();
  }

  mostrar_letras_usadas(): void {
    this.letrasUtilizadas = this.juego.informar_letras_utilizadas();
  }

  actualizarLetrasUtilizadas(): void {
    this.letrasUtilizadas = this.juego.informar_letras_utilizadas();
  }


  adivinarLetra() {
    if (this.letraControl.valid) {
      const letra = this.letraControl.value;
      if (letra) {
        this.juego.adivinar_letra(letra);
        this.mostrarProgreso();
        this.mostrar_letras_usadas();
        this.intentosRestantes = 6 - this.juego.get_cantidad_intentos_realizados();
        
        this.letraControl.reset();
        
        if (
          this.intentosRestantes <= 0 ||
          this.palabraMostrada === this.juego.informar_palabra_secreta()
        ) {
          this.openDialog(DialogReinicio, {
            resultado: this.juego.es_victoria_o_es_derrota(),
            palabraSecreta: this.juego.informar_palabra_secreta(),
          });
        }
      }
    }
  }

  onEnterKey() {
    this.adivinarLetra();
  }

  reiniciarJuego(confirmation: boolean) {
    if (!confirmation) {
      this.router.navigate([''], {});
    } else {
      this.juego.reiniciar_juego(confirmation);
      this.mostrarProgreso();
      this.intentosRestantes = 6;
      this.letrasUtilizadas = [];
      this.letraControl.reset();
    }
  }
}

import { Routes } from '@angular/router';
import { SelectorDificultadIdioma } from './components/selector-dificultad-idioma/selector-dificultad-idioma';
import { JuegoAhorcado } from './components/juego-ahorcado/juego-ahorcado';
export const routes: Routes = [
  { path: '', redirectTo: '/configuracion', pathMatch: 'full' },
  { path: 'configuracion', component: SelectorDificultadIdioma },
  { path: 'juego', component: JuegoAhorcado },
];

import { ApplicationConfig, provideBrowserGlobalErrorListeners, provideZoneChangeDetection } from '@angular/core';
import { provideRouter } from '@angular/router';

import { routes } from './app.routes';
import { provideClientHydration, withEventReplay } from '@angular/platform-browser';

export const appConfig: ApplicationConfig = {
  providers: [
    provideBrowserGlobalErrorListeners(),
    provideZoneChangeDetection({ eventCoalescing: true }),
    provideRouter(routes), provideClientHydration(withEventReplay())
  ]
};

import { Component, signal } from '@angular/core';
import { RouterOutlet } from '@angular/router';

@Component({
  selector: 'app-root',
  imports: [RouterOutlet],
  templateUrl: './app.html',
  styleUrl: './app.css',
})
export class App {
  protected readonly title = signal('ahorcado');
}
